import React, { useState, useEffect } from "react";
import CategorySection from "../components/CategorySection";
import GameDetailModal from "../components/GameDetailModal";
import VisitorCounter from "../components/VisitorCounter";

const Home = ({
  accounts,
  categories,
  deleteAccount,
  isLoggedIn,
  currentUser,
  pageViews,
  onIncrementPageViews,
}) => {
  const [selectedAccount, setSelectedAccount] = useState(null);
  const [isModalOpen, setIsModalOpen] = useState(false);

  useEffect(() => {
    onIncrementPageViews();
  }, []);

  const handleViewDetail = (account) => {
    setSelectedAccount(account);
    setIsModalOpen(true);
  };

  const handleCloseModal = () => {
    setIsModalOpen(false);
    setSelectedAccount(null);
  };

  return (
    <div className="min-h-screen">
      <div className="container mx-auto px-4 py-8">
        {/* HERO SECTION - BỐ CỤC MỚI SẶC SỠ */}
        <div className="mb-12">
          <div className="grid grid-cols-1 lg:grid-cols-5 gap-6 mb-8">
            {/* TÊN WEBSITE - CHIẾM 3 CỘT */}
            <div className="lg:col-span-3">
              <div className="bg-gradient-to-r from-blue-600 via-purple-600 to-cyan-500 rounded-3xl p-8 shadow-2xl border-2 border-white border-opacity-30 relative overflow-hidden">
                <div className="absolute inset-0 bg-gradient-to-r from-transparent via-white to-transparent opacity-10 animate-pulse"></div>
                <h1 className="text-5xl md:text-6xl font-bold text-white text-center mb-4 text-shadow-lg">
                  CHỢ ĐEN PUBG PC
                </h1>
                <div className="bg-white bg-opacity-20 rounded-2xl p-6 border border-white border-opacity-30 backdrop-blur-sm">
                  <p className="text-white text-2xl text-center font-bold">
                    MUA BÁN TRAO ĐỔI TÀI KHOẢN PUBG PC
                  </p>
                </div>
              </div>
            </div>

            {/* THÔNG TIN LIÊN HỆ - CHIẾM 2 CỘT */}
            <div className="lg:col-span-2">
              <div className="bg-gradient-to-br from-cyan-500 via-blue-600 to-purple-600 rounded-3xl p-6 shadow-2xl border-2 border-white border-opacity-30 h-full">
                <div className="text-center h-full flex flex-col justify-center">
                  <div className="bg-white bg-opacity-20 rounded-2xl p-6 mb-4 border border-white border-opacity-30 backdrop-blur-sm">
                    <p className="text-white text-lg font-bold mb-3">
                      LIÊN HỆ NGAY
                    </p>
                    <p className="text-white text-3xl font-bold bg-gradient-to-r from-yellow-300 to-amber-300 bg-clip-text text-transparent">
                      0922.010011
                    </p>
                  </div>
                  <div className="bg-gradient-to-r from-green-400 to-emerald-500 rounded-2xl p-4 border-2 border-white">
                    <p className="text-white text-sm font-bold">
                      HỖ TRỢ 24/7 - BẢO HÀNH UY TÍN
                    </p>
                  </div>
                </div>
              </div>
            </div>
          </div>

          {/* VISITOR COUNTER - VỊ TRÍ ĐẶC BIỆT */}
          <div className="flex justify-center mb-8">
            <div className="transform hover:scale-105 transition-transform duration-300">
              <VisitorCounter count={pageViews} />
            </div>
          </div>
        </div>

        {/* CATEGORIES */}
        {categories.map((category) => (
          <CategorySection
            key={category.id}
            category={category.name}
            accounts={accounts}
            onViewDetail={handleViewDetail}
            onDelete={deleteAccount}
            isLoggedIn={isLoggedIn}
            currentUser={currentUser}
          />
        ))}

        {accounts.length === 0 && (
          <div className="text-center py-20">
            <div className="bg-gradient-to-r from-blue-500 to-purple-600 rounded-3xl p-12 max-w-md mx-auto border-2 border-white border-opacity-30 shadow-2xl backdrop-blur-sm">
              <div className="w-20 h-20 bg-white bg-opacity-20 rounded-full flex items-center justify-center mx-auto mb-6 border-2 border-white border-opacity-30">
                <div className="w-10 h-10 bg-cyan-400 rounded-full animate-pulse shadow-lg"></div>
              </div>
              <h3 className="text-2xl font-bold text-white mb-4">
                ĐANG CẬP NHẬT NICK
              </h3>
              <p className="text-blue-100 text-lg">
                Chúng tôi đang bổ sung thêm nick game chất lượng!
              </p>
            </div>
          </div>
        )}

        <GameDetailModal
          account={selectedAccount}
          isOpen={isModalOpen}
          onClose={handleCloseModal}
        />
      </div>
    </div>
  );
};

export default Home;
